import React from 'react'

export const PopUp = ({isOpenPopUp}) => {
    const onClickBtn = () => {
        isOpenPopUp = false;
    }
    return (
        <div class="popup">
            <p>Title</p>
            <div class="popup_inner"></div>
            <button onClick={onClickBtn}>Начать игру</button>
        </div>
    )
}
